i am getting lazzzyyyy.&nbsp;WHY?&nbsp;I have&nbsp;NO idea.&nbsp;I need to desperately do my essay, at least outline it.&nbsp;
I 
when i was on the plane over&nbsp;here, i saw my TA for philosophy...John Jacobson. He knew my&nbsp;Muir 50 TA, Mike, I saw Mike at Trader Joe's a while ago and we were talking, but it was awkward. I wonder why..

I went to the spa yesterday for my face. They used a new type of laser for it though.&nbsp;

I need to interview Mama today for my Poli 181A seminar. As a practice for when I start doing the real interviews. huh.

hey hey hey!! so i have my interview at 330. yay. i really hope i get the job. that would make me really happy considering that i dont really like miami grille anymore because the people were being mean. i am really infatuated with....my coworker. . like i dont even know why...well i kinda know why. he is hot. hahaha!! and he is smart and a nerd and everything i like in a guy. yum. too bad he has a girlfriend. grr. i have a bunch of stuff to do and i've been putting it off.&nbsp;


1. personal statement and get it reviewed.
2. read at least one of the internship&nbsp;books by the end of next week.
3. math 10A worksheets&nbsp;



damnit. why am i not being productive??

I have officially decided to change my life for the better.&nbsp;


I love myself and I love others. I am finally going to follow through with it. I said it before, but I don't think I really wanted to make a change. Now I do. Finally.&nbsp;


"When you want something enough you'd do anything to have it, it is yours"


I am going to take charge of my life like never before. I do not care if I lose "friends" along the way. If I do not fit their definition, oh well.&nbsp;

When you get close to people they begin to define who you are supposed to be. In reality, they never know who themselves are. These type of people have unintentionally prevented me from knowing who I am. If we keep defining each other, we can never fully define ourselves.&nbsp;So I will take my past with grace and know that everything is a learning experience. I am going to stop doing things for others and start living my life.&nbsp;I have been given a life, I do not know why, but from my knowledge I only have one, and I have been given enough&nbsp;consciousness to make my own decisions and I am going to do just that.


I am not trying to become a "hermit crab" or "anti-social" or any other label but I just want to figure out who I am and what I want before its too late. Before I am 80 years old and still hoping to figure out what I really want, still feeling unsure about why I am doing what I am doing.&nbsp;

Fuck. It took me 19 years to figure out that its a cold hard world and people will squash you gently if you don't resist. I have finally come to the realization that I want to know who I am, what I want and who I have become (and why).&nbsp;


Going on my trip changed my life, although I didn't realize how much until now. I just saw how people live their lives solely based on society's standards and definitions; even choosing whether or not to wear shorts on a hot day. When I saw the way that people were living their lives, I realized that I was living mine in the same way, just in a different context. I was disgusted with myself and who I had become. That is a surreal feeling. Whats more, is that it was the second time it had happened to me. I would usually put this as a private entry, but if someone reads this and it helps them, then good. If someone reads this and thinks it is bullshit, oh well. I am apathetic. I love you anyway.
